summary.text:
An element that is displayed only if the current route starts with elements path attribute.

For example,
 route({path: "/proc"},
     div(
         "proc",
         div({path: "/cpuinfo"},
             "cpuinfo"
             )
         )
     )

 You can override this behavior by setting the attribute, absolute to any value

 route({path: "/usr"},
     div(
         "proc",
         div({path: "/cpuinfo", absolute: true},
             "cpuinfo"
             )
         )
     )

readme.text:
```javascript
import { div, b } from '@srfnstack/fntags'

// A simple component
const Greeting = (name) => {
    return div( "Hello, ", b(name), "!")
}

document.body.append(
    Greeting("Developer")
)
```

```javascript
import { fnstate } from '@srfnstack/fntags'
import { div, button } from '@srfnstack/fntags'

const Counter = () => {
    const count = fnstate(0)

    return div(
        div('Count: ', count.bindAs()),
        button({
            onclick: () => count(count() + 1)
        }, 'Increment')
    )
}

document.body.append(Counter())
```
